function Home() {
  return (
    <div className="Gallery container">
      <div className="row">
        <div className="col-sm-4" style={{ backgroundColor: "lavender" }}>
          <img className="img-fluid" src="https://picsum.photos/800" alt=""/>
        </div>
        <div className="col-sm-8" style={{ backgroundColor: "lavenderblush" }}>.col-sm-8</div>
      </div>
      <div className="row">
        <div className="col-sm-8" style={{ backgroundColor: "lavenderblush" }}>.col-sm-8</div>
        <div className="col-sm-4" style={{ backgroundColor: "lavender" }}>
          <img className="img-fluid" src="https://picsum.photos/800" alt=""/>
        </div>
        
      </div>
    </div>
  );
}

export default Home;
